import React from "react";
import { withRouter } from "react-router-dom";
import "../../App.css";
import loginImg from "../../money.svg";
import {Redirect, Link} from "react-router-dom";
import { 
    INDEX_PATH
   } from "../../constants/pageNames";

class AdminPage extends React.Component {

    state = {
        redirect: false
    }
    redirectHandler = () => {
        this.setState({ redirect: true })
        this.renderRedirect();
    }
    renderRedirect = () => {
        if (this.state.redirect) {
            return <Redirect to='/' />
        }
    }
    render(){
        return(

            <div className="admin-top-left-container">
                <div className="logo">
                    <img src={loginImg}/>
                </div>
                <div className="admin-top-middle-container">
                    Powered By EduPay
                </div>
                <div className="admin-top-right-container">
                    <button className="btn"  onClick={this.redirectHandler}>
                        Logout
                    </button>
                </div>

            </div>

        )
    }

}

export default AdminPage;
